import {React, View} from 'react';
import './App.css';

var Circle = React.createClass({
    render: function() {
        return (
            <View class='circle' />
        )
    }
})

class menu extends React.Component{
  render(){

    return (
      <div>
      <a href="app.js" style="text-decoration: none; color: white;"><span class="dotS" style="margin: 0px 20px 0px 75px;" onmouseover="darken(this)" onmouseout="normal(this)"><div class="centered">Home</div></span></a>

      <a href="cs.html" style="text-decoration: none"><span class="dotM" onmouseover="darken(this)" onmouseout="normal(this)"><div class="centered">Computer Science</div></span></a>

      <a href="language.html" style="text-decoration: none"><span class="dotS"onmouseover="darken(this)" onmouseout="normal(this)"><div class="centered">Language</div></span></a> &nbsp;&nbsp;&nbsp;

      <a href="fotos.html" style="text-decoration: none"><span class="dotM"onmouseover="darken(this)" onmouseout="normal(this)"><div class="centered">Photos + Design</div></span></a>

      <a href="resume.html" style="text-decoration: none"><span class="dotS"onmouseover="darken(this)" onmouseout="normal(this)"><div class="centered">Resume</div></span></a>


  <div style="padding-left:64px;"><h2>
  <div style="color:#8375A5;display:inline;" > Sophia </div>
    Gigliotti <img class="profilem" src="fotos\sop.png" style="width: 6%; margin-left: 45px;"/> </h2> </div>



      </div>
    );

  }

}

export default menu;
